import React from "react";

const Presentacion = () => {
  return (
    <div className="presentacion">
      <div className="presentacion__container">
        <div>
            <h1>Alejandro Guespud</h1>
            <img></img>
        </div>
        <div>
            <p></p>
        </div>
      </div>
    </div>
  );
};

export default Presentacion;
